Triangle Kush Distillate 1 g by Oleum Extracts --- 80.8%-84.8% THC 0%-2.0% CBD Triangle Kush is an indica originating in Florida, named after the state's three cannabis-producing capitals: Jacksonville, Miami, and Tampa. Indoor or outdoor grows are low yielders, but clear, active effects stimulating creativity and discussion drive this strain's production. Flowers are expected at around 70 days. Also known as Florida OG Kush or OG Triangle
Genetics:  Chemdawg x {Lemon Thai x Hindu Kush, Pakistan}
